INSERT INTO `chuck_norris_facts` VALUES (10,'\r\n\"Chuck Norris can sneeze with his eyes open. \"'),(11,'\r\n\"Chuck Norris can eat just one Lay\'s potato chip.\"'),(9,'\r\n\"Apple pays Chuck Norris 99 cents every time he listens to a song.\"'),(8,'\r\n\"There is no \'ctrl\' button on Chuck Norris\'s computer. Chuck Norris is always in control.\"'),(7,'If you have five dollars and Chuck Norris has five dollars, Chuck Norris has more money than you.'),(12,'\r\n\"Chuck Norris is suing Myspace for taking the name of what he calls everything around you.\"'),(13,'\r\n\"Chuck Norris destroyed the periodic table, because he only recognizes the element of surprise\"'),(14,'\r\n\"Chuck Norris can kill two stones with one bird.\"'),(15,'\r\n\"When the Boogeyman goes to sleep every night, he checks his closet for Chuck Norris\"'),(16,'\r\n\"Chuck Norris doesn\'t read books. He stares them down until he gets the information he wants.\"'),(17,'\r\n\"There is no theory of evolution. Just a list of creatures Chuck Norris has allowed to live.\"'),(18,'\r\n\"Outer space exists because it\'s afraid to be on the same planet with Chuck Norris.\"'),(19,'\r\n\"Chuck Norris does not sleep. He waits.\"'),(20,'\r\n\"Chuck Norris is currently suing NBC, claiming Law and Order are trademarked names for his left and right legs\"'),(21,'\r\n\"Chuck Norris is the reason why Waldo is hiding.\"'),(22,'\r\n\"Chuck Norris counted to infinity - twice.\"'),(23,'\r\n\"There is no chin behind Chuck Norris'),(24,'\r\n\"When Chuck Norris does a pushup, he isn'),(25,'\r\n\"Chuck Norris is so fast, he can run around the world and punch himself in the back of the head.\"'),(26,'\r\n\"Chuck Norris'),(27,'\r\n\"Chuck Norris can lead a horse to water AND make it drink.\"'),(28,'\r\n\"Chuck Norris doesn'),(29,'\r\n\"Chuck Norris can slam a revolving door.\"'),(30,'\r\n\"Chuck Norris does not get frostbite. Chuck Norris bites frost.\"'),(31,'\r\n\"Remember the Soviet Union? They decided to quit after watching a DeltaForce marathon on Satellite TV.\"'),(32,'\r\n\"Contrary to popular belief, America is not a democracy, it is a Chucktatorship.\"'),(33,'\r\n\"The chief export of Chuck Norris is Pain.\"'),(34,'\r\n\"Chuck Norris has two speeds. Walk, and Kill.\"'),(35,'\r\n\"The leading causes of death in the United States are: 1. Heart Disease 2. Chuck Norris 3. Cancer.\"'),(36,'\r\n\"Chuck Norris drives an ice cream truck covered in human skulls.\"'),(37,'\r\n\"Chuck Norris uses pepper spray to spice up his steaks.\"'),(38,'\r\n\"Chuck Norris once roundhouse kicked someone so hard that his foot broke the speed of light, went back in time, and killed Amelia Earhart while she was flying over the Pacific Ocean.\"'),(39,'\r\n\"Crop circles are Chuck Norris\' way of telling the world that sometimes corn needs to lie down.\"'),(40,'\r\n\"Chuck Norris is ten feet tall, weighs two-tons, breathes fire, and could eat a hammer and take a shotgun blast standing.\"'),(41,'\r\n\"The Great Wall of China was originally created to keep Chuck Norris out. It failed miserably.\"'),(42,'\r\n\"Contrary to popular belief, Chuck Norris, not the box jellyfish of northern Australia, is the most venomous creature on earth. Within 3 minutes of being bitten, a human being experiences the following symptoms: fever, blurred vision, beard rash, tightness of the jeans, and the feeling of being repeatedly kicked through a car windshield.\"'),(43,'\r\n\"Most people have 23 pairs of chromosomes. Chuck Norris has 72... and they\'re all poisonous.\"'),(44,'\r\n\"When Chuck Norris sends in his taxes, he sends blank forms and includes only a picture of himself, crouched and ready to attack. Chuck Norris has not had to pay taxes, ever.\"'),(45,'\r\n\"The quickest way to a man\'s heart is with Chuck Norris\' fist.\"'),(46,'\r\n\"Chuck Norris invented Kentucky Fried Chicken\'s famous secret recipe, with eleven herbs and spices. But nobody ever mentions the twelfth ingredient: Fear.\"'),(47,'\r\n\"CNN was originally created as the Chuck Norris Network to update Americans with on-the-spot ass kicking in real-time.\"'),(48,'\r\n\"Chuck Norris can win a game of Connect Four in only three moves.\"'),(49,'\r\n\"Chuck Norris once ate three 72 oz. steaks in one hour. He spent the first 45 minutes having sex with his waitress.\"'),(50,'\r\n\"What was going through the minds of all of Chuck Norris\' victims before they died? His shoe.\"'),(51,'\r\n\"Chuck Norris is the only man to ever defeat a brick wall in a game of tennis.\"'),(52,'\r\n\"Police label anyone attacking Chuck Norris as a Code 45-11.... a suicide.\"'),(53,'\r\n\"Chuck Norris doesn\'t churn butter. He roundhouse kicks the cows and the butter comes straight out.\"'),(54,'\r\n\"Chuck Norris doesn'),(55,'\r\n\"A Handicapped parking sign does not signify that this spot is for handicapped people. It is actually in fact a warning, that the spot belongs to Chuck Norris and that you will be handicapped if you park there.\"'),(56,'\r\n\"Chuck Norris will attain statehood in 2009. His state flower will be the Magnolia.\"'),(57,'\r\n\"Someone once videotaped Chuck Norris getting pissed off. It was called Walker: Texas Chain Saw Massacre.\"'),(58,'\r\n\"If you spell Chuck Norris in Scrabble, you win. Forever.\"'),(59,'\r\n\"The opening scene of the movie Saving Private Ryan is loosely based on games of dodgeball Chuck Norris played in second grade.\"'),(60,'\r\n\"Chuck Norris once shot down a German fighter plane with his finger, by yelling \'Bang!\'\"'),(61,'\r\n\"Chuck Norris once bet NASA he could survive re-entry without a spacesuit. On July 19th,1999, a naked Chuck Norris re-entered the earth\'s atmosphere, streaking over 14 states and reaching a temperature of 3000 degrees. An embarrassed NASA publically claimed it was a meteor, and still owes him a beer.\"'),(62,'\r\n\"Chuck Norris has two speeds: Walk and Kill.\"'),(63,'\r\n\"Someone once tried to tell Chuck Norris that roundhouse kicks aren\'t the best way to kick someone. This has been recorded by historians as the worst mistake anyone has ever made.\"'),(64,'\r\n\"Contrary to popular belief, America is not a democracy, it is a Chucktatorship.\"'),(65,'\r\n\"Teenage Mutant Ninja Turtles is based on a true story: Chuck Norris once swallowed a turtle whole, and when he crapped it out, the turtle was six feet tall and had learned karate.\"'),(66,'\r\n\"Chuck Norris is not hung like a horse... horses are hung like Chuck Norris.\"'),(67,'\r\n\"Chuck Norris is the only human being to display the Heisenberg uncertainty principle -- you can never know both exactly where and how quickly he will roundhouse-kick you in the face.\"'),(68,'\r\n\"In the Bible, Jesus turned water into wine. But then Chuck Norris turned that wine into beer.\"'),(69,'\r\n\"Chuck Norris can hit you so hard that he can actually alter your DNA. Decades from now your descendants will occasionally clutch their heads and yell \'What The Hell was That?\'\"'),(70,'\r\n\"Time waits for no man. Unless that man is Chuck Norris.\"'),(71,'\r\n\"In an average living room there are 1,242 objects Chuck Norris could use to kill you, including the room itself.\"'),(72,'\r\n\"Pluto is actually an orbiting group of British soldiers from the American Revolution who entered space after the Chuck gave them a roundhouse kick to the face.\"'),(73,'\r\n\"When Chuck Norris goes to donate blood, he declines the syringe, and instead requests a hand gun and a bucket.\"'),(74,'\r\n\"Chuck Norris was the fourth wise man, who gave baby Jesus the gift of beard, which he carried with him until he died. The other three wise men were enraged by the preference that Jesus showed to Chuck\'s gift, and arranged to have him written out of the bible. All three died soon after of mysterious roundhouse-kick related injuries.\"'),(75,'\r\n\"Chuck Norris once ate a whole cake before his friends could tell him there was a stripper in it. Some people like to eat frogs\' legs. Chuck Norris likes to eat lizard legs. Hence, snakes.\"'),(76,'\r\n\"There are no races, only countries of people Chuck Norris has beaten to different shades of black and blue.\"'),(77,'\r\n\"When Chuck Norris was denied an Egg McMuffin at McDonald\'s because it was 10:35, he roundhouse kicked the store so hard it became a Wendy\'s.\"'),(78,'\r\n\"A Chuck Norris-delivered Roundhouse Kick is the preferred method of execution in 16 states.\"'),(79,'\r\n\"When Chuck Norris falls in water, Chuck Norris doesn\'t get wet. Water gets Chuck Norris.\"'),(80,'\r\n\"Scientists have estimated that the energy given off during the Big Bang is roughly equal to 1CNRhK (Chuck Norris Roundhouse Kick).\"'),(81,'\r\n\"Chuck Norris'),(82,'\r\n\"How much wood would a woodchuck chuck if a woodchuck could Chuck Norris? ...All of it.,,\"'),(83,'\r\n\"Chuck Norris doesn\'t actually write books, the words assemble themselves out of fear.\"'),(84,'\r\n\"In honor of Chuck Norris, all McDonald\'s in Texas have an even larger size than the super-size. When ordering, just ask to be Chucksized.\"'),(85,'\r\n\"Chuck Norris CAN believe it\'s not butter.\"'),(86,'\r\n\"If tapped, a Chuck Norris roundhouse kick could power the country of Australia for 44 minutes.\"'),(87,'\r\n\"Chuck Norris can divide by zero.\"'),(88,'\r\n\"The grass is always greener on the other side, unless Chuck Norris has been there. In that case the grass is most likely soaked in blood and tears.\"'),(89,'\r\n\"A picture is worth a thousand words. A Chuck Norris is worth 1 billion words.\"'),(90,'\r\n\"Newton\'s Third Law is wrong: Although it states that for each action, there is an equal and opposite reaction, there is no force equal in reaction to a Chuck Norris roundhouse kick.\"'),(91,'\r\n\"When an episode of Walker Texas Ranger was aired in France, the French surrendered to Chuck Norris just to be on the safe side.,\"'),(92,'\r\n\"While urinating, Chuck Norris is easily capable of welding titanium.\"'),(93,'\r\n\"Chuck Norris once sued the Houghton-Mifflin textbook company when it became apparent that their account of the war of 1812 was plagiarized from his autobiography.\"'),(94,'\r\n\"When Chuck Norris talks, everybody listens. And dies.\"'),(95,'\r\n\"When Steven Seagal kills a ninja, he only takes its hide. When Chuck Norris kills a ninja, he uses every part.\"'),(96,'\r\n\"Contrary to popular belief, there is indeed enough Chuck Norris to go around.\"'),(97,'\r\n\"Chuck Norris doesnt shave'),(98,' he kicks himself in the face. The only thing that can cut Chuck Norris is Chuck Norris.\"'),(99,'\r\n\"For some, the left testicle is larger than the right one. For Chuck Norris, each testicle is larger than the other one.\"'),(100,'\r\n\"Chuck Norris always knows the EXACT location of Carmen SanDiego.\"'),(101,'\r\n\"When taking the SAT, write \'Chuck Norris\' for every answer. You will score over 8000.\"'),(102,'\r\n\"Chuck Norris invented black. In fact, he invented the entire spectrum of visible light. Except pink. Tom Cruise invented pink.,,,\"'),(103,'\r\n\"When you\'re Chuck Norris, anything + anything is equal to 1. One roundhouse kick to the face.\"'),(104,'\r\n\"Chuck Norris has the greatest Poker-Face of all time. He won the 1983 World Series of Poker, despite holding only a Joker, a Get out of Jail Free Monopoloy card, a 2 of clubs, 7 of spades and a green #4 card from the game UNO.\"'),(105,'\r\n\"On his birthday, Chuck Norris randomly selects one lucky child to be thrown into the sun.\"'),(106,'\r\n\"Nobody doesn\'t like Sara Lee. Except Chuck Norris.\"'),(107,'\r\n\"Chuck Norris doesn\'t throw up if he drinks too much. Chuck Norris throws down!\"'),(108,'\r\n\"In the beginning there was nothing...then Chuck Norris Roundhouse kicked that nothing in the face and said \'Get a job\'. That is the story of the universe.\"'),(109,'\r\n\"Chuck Norris has 12 moons. One of those moons is the Earth.\"'),(110,'\r\n\"Chuck Norris grinds his coffee with his teeth and boils the water with his own rage.\"'),(111,'\r\n\"Archeologists unearthed an old english dictionary dating back to the year 1236. It defined \'victim\' as \'one who has encountered Chuck Norris\'.\"'),(112,'\r\n\"Chuck Norris ordered a Big Mac at Burger King, and got one.\"'),(113,'\r\n\"Chuck Norris and Mr. T walked into a bar. The bar was instantly destroyed, as that level of awesome cannot be contained in one building.\"'),(114,'\r\n\"If you Google search \'Chuck Norris getting his ass kicked\' you will generate zero results. It just doesn\'t happen.\"'),(115,'\r\n\"Chuck Norris can drink an entire gallon of milk in thirty-seven seconds.\"'),(116,'\r\n\"Little known medical fact: Chuck Norris invented the Caesarean section when he roundhouse-kicked his way out of his mother\'s womb.\"'),(117,'\r\n\"Chuck Norris doesn\'t bowl strikes, he just knocks down one pin and the other nine faint.\"'),(118,'\r\n\"The show Survivor had the original premise of putting people on an island with Chuck Norris. There were no survivors, and nobody is brave enough to go to the island to retrieve the footage.\"'),(119,'\r\n\"It takes Chuck Norris 20 minutes to watch 60 Minutes.\"'),(120,'\r\n\"You know how they say if you die in your dream then you will die in real life? In actuality, if you dream of death then Chuck Norris will find you and kill you.\"'),(121,'\r\n\"Chuck Norris has a deep and abiding respect for human life... unless it gets in his way.\"'),(122,'\r\n\"The Bermuda Triangle used to be the Bermuda Square, until Chuck Norris Roundhouse kicked one of the corners off.\"'),(123,'\r\n\"There are no weapons of mass destruction in Iraq, Chuck Norris lives in Oklahoma.\"'),(124,'\r\n\"Chuck Norris doesn\'t believe in Germany.\"'),(125,'\r\n\"When Chuck Norris is in a crowded area, he doesn\'t walk around people. He walks through them.\"'),(126,'\r\n\"Chuck Norris once ate an entire bottle of sleeping pills. They made him blink.\"'),(127,'\r\n\"James Cameron wanted Chuck Norris to play the Terminator. However, upon reflection, he realized that would have turned his movie into a documentary, so he went with Arnold Schwarzenegger.\"'),(128,'\r\n\"Chuck Norris can touch MC Hammer.\"'),(129,'\r\n\"Thousands of years ago Chuck Norris came across a bear. It was so terrified that it fled north into the arctic. It was also so terrified that all of its decendents now have white hair.\"'),(130,'\r\n\"Chuck Norris played Russian Roulette with a fully loaded gun and won.\"'),(131,'\r\n\"It takes 14 puppeteers to make Chuck Norris smile, but only 2 to make him destroy an orphanage.\"');
