INSERT INTO `crewmembers` VALUES (1,'Tim','Lyda','images/roster_headshots/missing_image.jpg','Tim Lyda',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0),(2,'Dan ','Quinones','images/roster_headshots/dan _quinones_headshot.jpg','As the self-proclaimed &quot;Leader of the Pack&quot;, Dan enjoys answering a question with a question, anything ADD and talking in the 3rd person. He is a father of 3 and a husband of 1 and likes to do work around the mini ranch. He has recently purchased a tractor and a rig that burns the deis to make up for the recent Prius purchase that all the minivan drivers be hatin&#039;. If you are looking to get on the crew and earn an honest wage, give him a call and drop by the base...he&#039;ll be the one glaring at you though the drive up window.','541-946-3267','dquinones@fs.fed.us','3210 Robertson Bridge Rd','','Grants Pass','OR','97526',0),(3,'Dan ','Quinones','images/roster_headshots/dan _quinones_headshot.jpg','Dan is the brand new, 2009 version of a crew Foreman. He hails from So Cal, but grew up in Medford. After chasing butterflies in Prineville as the Assistant Foreman for the Central Oregon Rappellattackers,  he has returned. He is a husband of 14 years, has 3 girls, 18 chickens, 2 dogs, 1 parakeet, 1 guinea pig and 6 ducks. Let&#039;s all have a moment of silence for Dan.....','541-946-3267','srcquinones@gmail.com','3210 Robertson Bridge Rd','','Grants Pass','OR','97526',1),(4,'Dan ','Quinones','images/roster_headshots/dan _quinones_headshot.jpg','DQ&#039;s hobby farm. Ducks, pigs, and a malamute... Is this a haiku?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0),(5,'Tim ','Lyda','images/roster_headshots/missing_image.jpg','Assistant Forman',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0),(6,'Tim ','Lyda','images/roster_headshots/tim _lyda_headshot.jpg','Tim started on the crew in 1985.','541-761-2676','tmlyda@fs.fed.us, tim@siskiyourappellers.com','415 SE I St.','','Grants Pass','Or','97526',0),(96,'Tony','Allabastro','images/roster_headshots/missing_image.jpg','