nd Hotshots before finding his niche in aviation.  He loves training the up and comers on the crew, rafting the river and cutting firewood 4 inches longer than your wood stove can hold. If you ever have any questions about the crew, give Nick a call and he&#039;ll give you the straight scoop. Just don&#039;t call him on his new cell phone, it&#039;s at the bottom of the Rogue.','760-258-6446','nssailer@gmail.com','311 NW A St.','','Grants Pass','OR','97526',0),(20,'Cole ','Taggart','images/roster_headshots/cole _taggart_headshot.jpg','','307-259-9861','cole_taggart307@hotmail.com','3310 Brookview Dr.','','Casper','Wy','82604',0),(36,'Andrew','Larrimore','images/roster_headshots/andrew_larrimore_headshot.jpg','Richard! Larrimore... Much can be said of this son from North Carolina. SRC is still hoping to get a full year of work outta him.. but the Grand Ronde beckons. While he is here you can always count on his calm well thought out wisdom summed up and to the point. When his hands aren&#039;t gracefully guiding oars through a torrent of water.. they can usually be found finishing off someone&#039;s bag of chips. Yes Richard Andrew Larrimore (a.k.a. no name fair game) is a hungry fellow, and it takes a crew to keep this man fed. but just one look at his stature and you&#039;ll understand.. not petite.. just keep your hands and small children away from his mouth and everything will be fine.','307-431-6165','andrewlarrimore@gmail.com','128 Hillside Ave','','Klamath Falls','OR','97601',0),(21,'Mark','Heintzelman','images/roster_headshots/mark_heintzelman_headshot.jpg','','630-415-5572','adventureaway@yahoo.com','310 Surrey Ln.','','Bloomington','IL','60108',0),(22,'Charity','Houpt','images/roster_headshots/charity_houpt_headshot.jpg','','541-620-1525','','','','John Day','OR','',0),(23,'Ryan ','Rupert','images/roster_headshots/ryan _rupert_headshot.jpg','','717-586-4136','ryanw_rupert@yahoo.com','','','Ashland','OR','',0),(26,'Evan ','Hsu','images/roster_headshots/evan 