INSERT INTO `current` VALUES ('evanhsu','2010-12-14 22:35:31','If you are interested in a temporary position on the crew for the 2011 season you should be contacting us soon....very, very soon. We will be requesting a referral list in January.<br />\r\n<br />\r\nThe referral list for the GS-0462-4/5 Senior Firefighter has been requested, however the announcement has been closed due to IFPM requirements. If you applied initially, you will receive an e-mail with instructions on how to ensure you will be on the list. If you did not apply, here is your chance to redeem yourself. The new OCR will be out on December 3rd and we will be requesting a list the first week of January.'),('dquinones','2010-12-17 13:58:07','The recruiting page has been updated with the most up to date information and AVUE announcement links for the 2011 season. Please read the announcement and all associated documentation completely to ensure you apply correctly.'),('dquinones','2010-12-13 10:00:00','Congratulations to Evan Hsu, the Siskiyou Rappel Crew&#039;s 2010 Rappeller of the Year.'),('evanhsu','2010-12-14 22:45:37','The Siskiyou Rappel Crew is now on Facebook!  The information on our &#039;Current Status&#039; page will now also be available on our Facebook page: http://www.facebook.com/pages/Siskiyou-Rappel-Crew/116587918401126?v=wall'),('dquinones','2010-12-15 17:59:05','Make sure to check out the &quot;Off-Season Prep&quot; section of our website to make sure you are ready for the 2011 season, and the &quot;Recruiting&quot; section to make sure you have a chance at a job on the crew.'),('dquinones','2011-01-05 18:09:34','We have received the referral lists for the temporary positions and we are in the process of reviewing them. Reference checks and phone calls will take place next week, with selections to follow shortly thereafter. '),('dquinones','2011-01-12 09:36:15','We have received the GS-4/5 Senior Firefighter list and are currently working through it. Depending on the schedule of management, we hope to have this finished in a couple of weeks. Stay tuned and in touch.'),('dquinones','2011-01-24 20:18:56','We will be presenting our selection for the Senior Firefighter to the Forest Supervisor on February 10th. If you received an interview you will be contacted with the results. As always, thank you for your interest in our program.'),('dquinones','2011-02-10 15:26:13','The selection for the Senior Firefighter position has been made and is off to ASC. Once we get the qualifications check back, the offer will be made and notifications to the individuals who received interviews will be made. <br />\r\n<br />\r\nRound 1 of the temporary hiring for the 2011 season is also complete. With some potential movement in the current roster, we may be requesting a second referral list in the weeks to come. If you still want a shot at getting on the crew, make sure that your AVUE application is up to date and you have attached all the required documentation. Call if you have questions, and good luck.'),('dquinones','2011-02-17 18:52:31','Congratulations to Sarah Uvodich, our new GS-5 Senior Firefighter. We look forward to having her on the crew to assist in the Equipment and Operations Department starting in March.<br />\r\n'),('tlyda','2011-02-22 09:21:34','Round two of the temp hiring has now begun, We maybe hiring up to 2 positions. If you are still interested make sure you have your application updated and give us a call or set up a time to stop by.'),('dquinones','2011-04-01 08:05:18','The hiring for the 2011 crew is complete. Thanks to all who applied and were not selected, we hope to see you on the list for next season.'),('dquinones','2011-04-05 14:42:57','Congratulations are in order to Brandon Nelson. He is officially leaving the crew to move into his new permanent position on the Umpqua NF. We are confident that he will continue to lead and train less experienced crewmembers in his new position. <br />\r\nGood job Brandon, you earned it.<br />\r\n'),('evanhsu','2011-04-24 11:07:28','Happy Easter!<br />\r\nRappel Academy 1 of 5 starts tomorrow and SRC will be there.  The 2011 season is about to begin...'),('evanhsu','2011-04-26 22:43:45','Training hard with rappellers from across the nation.  The first live rappels of 2011 were conducted today between snow flurries in John Day.'),('evanhsu','2011-04-30 12:07:59','The first national veteran recertification has been successfully completed.  Rappellers touched down into 4 inches of snow on Friday morning to finish the last of their training.<br />\r\n<br />\r\nRe-cert #2 begins Monday morning with a fresh batch of rappellers and spotters...'),('evanhsu','2011-05-06 22:26:53','The 2nd Veteran Rappeller Re-Certification for 2011 has been completed.  The entire veteran staff of the Siskiyou Rappel Crew is now re-certified for the coming fire season and ready to train our new crewmembers starting on Monday...'),('evanhsu','2011-05-13 19:08:15','The first week of rookie training has been completed.  Everyone gave their sweat and blood for the crew this week as body and mind were tested - next week we should be able to throttle the program up to full speed.'),('evanhsu','2011-05-23 22:57:40','Field week complete!<br />\r\nNow it&#039;s back to the classroom for helicopter crewmember training.'),('dquinones','2011-06-05 21:42:29','The National Rookie Rappel Academy is here. We look forward to seeing the rookies continue the tradition of hard work and perseverance throughout the week.<br />\r\nWe will also be keeping the memory of T.J. Marovich in our thoughts. Without him this national program would not have happened.'),('dquinones','2011-06-13 08:11:06','The 2011 Rookie Rappel Academy is now over. All the SRC rookies successfully navigated their way through the program and came out the other side as academy graduates. <br />\r\nNow we wait to see when they can put their new found skills to use in the real world.'),('evanhsu','2011-06-23 20:44:55','We currently have crewmembers scattered around the country: Nick &amp; Cole are in AZ helping out with the Wallow Fire, Sarah is in New Mexico with the Malheur module and Tim is in Georgia on the Okefenokee.  The rest of the crew is at home on the Rogue-Siskiyou, staffing for initial attack.'),('dquinones','2011-06-27 16:48:38','All is calm on the home front, but pretty hectic on the national scale. A few people still out on assignment, our engineer putting a fresh coat of wax on the helicopter and the rest of the crew busy with base operations and training.<br />\r\nWe wait.'),('dquinones','2011-06-28 20:11:53','The crew and helicopter is off to New Mexico in the morning to help out on the Los Conchas fire. '),('dquinones','2011-07-10 09:24:57','Helicopter and crew are currently at Lakeside Helibase in Cochiti, NM. Hot weather and active fire behavior are the norm.<br />\r\nHappy birthday goes out to our IT guy and lead crew member, Evan Hsu.'),('dquinones','2011-07-15 19:59:31','The whole crew is back at the base and getting ready for fire season in the Pacific Northwest after a good fire assignment in NM. <br />\r\nSome belated www.HappyBirthdaywishes.com also go out to Sarah Uvodich our hairstylist and senior firefighter on the crew. '),('dquinones','2011-08-02 10:49:53','Red Flag Warnings and hot temps in our coverage area, this means facilities improvements and training drills around the base. <br />\r\nCoiled springs.'),('dquinones','2011-08-12 17:56:23','Holding pattern people.......holding pattern.'),('dquinones','2011-08-13 12:44:32','Today is the last day for Kit Colbenson to be on the crew. Kit is moving on to the Siskiyou Mountains Ranger District of the Rogue River-Siskiyou NF to be on an engine. He has dedicated 9 years to the Siskiyou Rappel Crew, leading the way for up and coming crewmembers. <br />\r\nHis smile, calm demeanor and desire to improve the program will be missed.'),('dquinones','2011-08-20 12:41:45','Several state fires over the last few days and lightning predicted on the forest. Fire season 2011? We will see.'),('dquinones','2011-08-23 11:47:55','Rappellers in Crater Lake NP, boosters from Central Oregon and dry lightning predicted. '),('dquinones','2011-09-01 15:08:23','16 Siskiyou Rappellers are on the Nasty Fire, in the Opal Creek Wilderness on the Willamette, NF. They are being assisted by rappellers from multiple regions, which brings the grand total to 30 rappellers on the fire.<br />\r\nThey are all working hard to limit the fire growth, and we don&#039;t envy their packout.'),('dquinones','2011-12-08 10:13:24','Congratulations are in order for Mr. and Mrs. Hsu. Evan and Mary were married on December 3rd and are currently planning their honeymoon to tropical Iceland. I for one cannot wait for the photos.'),('dquinones','2011-12-08 10:18:26','With the weather in Southern Oregon being cold and foggy, that can only mean one thing....hiring. We will begin our 2012 temporary hiring process in January, so get your applications dusted off and into AVUE by December 31st.<br />\r\nThe links to the current OCR&#039;s are under our recruiting tab, and give us a call if you have any questions.<br />\r\nBottom line-If your name is not on the list, you won&#039;t be on the crew. Work hard and don&#039;t be left behind.'),('evanhsu','2011-10-24 15:39:52','The season is officially over and all of SRC&#039;s crewmembers have entered hibernation.  Preparations for 2012 are underway...'),('evanhsu','2011-10-24 15:42:18','The votes are in: Congratulations to Mat Murray, the 2011 SRC Rappeller of the Year!  Well played, my friend.'),('dquinones','2011-10-11 08:20:59','Home from John Day, the last fire of the season is in the books. The exciting life of burning, winterizing and close outs are in our future.<br />\r\nWe&#039;re not entirely done yet, but we&#039;re close.'),('evanhsu','2011-09-08 18:07:10','The Nasty Fire is winding down with only 4 rappellers remaining on scene to monitor.  The rest of the rappel community is staffing fires following an inexplicable storm pattern covering most of the state of Oregon.'),('dquinones','2011-09-15 10:40:50','The crew and helicopter are currently at Toketee HB on the Umpqua, NF. A cooler weather pattern has moved us into large fire support mode, and reminded us of the importance of layering.'),('dquinones','2011-12-16 13:33:27','Our GS-462-4/5 Senior Firefighter position on the crew is currently being outreached however, AVUE is in the process of revising the OCR for this position so it will not be available on the web until December 23, 2011. We will update the link on our recruiting page once this happens. The temporary GS-4 and GS-5 links are good to go.<br />\r\nIf you have any further questions on how to apply to any of these positions, call the base or drop us an e-mail and we&#039;ll get you up to speed.'),('dquinones','2012-01-03 11:53:24','The announcement numbers for the GS-5 Senior Firefighter position have been updated on our recruiting page as of today. The temporary announcement numbers are still current and we have requested a referral list to begin round 1 of the 2012 hiring process.<br />\r\nWe are back in the office, so give us a call with any questions.'),('dquinones','2012-01-24 15:27:37','Temporary hiring for the 2012 fire season is coming to a close. We may still have one position left to fill though, so keep in contact if your are still interested.<br />\r\nThe GS-4/5 Senior Firefighter referral list has also been requested and we should be seeing that in the next week. Interviews and reference checks will then begin.'),('dquinones','2012-02-22 11:06:33','Due to a change in the referral list request process for 2012, we have not yet received our list. We look to have it by the end of the week though.<br />\r\nConsider yourself updated.'),('dquinones','2012-03-13 14:47:33','We have received the list for our GS-4/5 Senior Firefighter position and the hiring team went to work on it. We have made a selection and are going down the path of approvals. We should have it to the RO by the end of the week.<br />\r\n'),('dquinones','2012-04-09 07:58:27','Only 6 days left for anyone interested in applying for the GS-6/7 Lead Crew detail!'),('dquinones','2012-04-23 15:41:11','Please welcome me in congratulating Nick Sailer as our new Senior Firefighter on the Siskiyou Rappel Crew. Nick has been a temporary seasonal on our crew since 2009 and has worked hard to advance his skills in both fire and aviation. He has held positions with the Minnesota Department of Natural Resources, the USFS at Mammoth Lakes, the Boundary Peak hand crew, the Sierra Hotshots and the Siskiyou Rappel Crew in his 11 year career. Nick&acirc;€™s great personality, strong work ethic and his desire to mentor those around him will make him an asset to the crew and the forest. He is currently attending his last training session as a temporary employee and will start in his new job May 7th. '),('evanhsu','2012-05-04 10:13:37','It all starts on Monday (5/7).  Get ready.'),('evanhsu','2012-05-21 18:48:48','Field Week complete.  On to helicopter crewmember class...'),('evanhsu','2012-05-30 07:01:29','Week 4 of rookie training - almost there...'),('dquinones','2012-06-04 13:55:21','The rookies are off to Salmon Idaho to join the rest of their peers at the National Rappel Academy. Back home we are tidying up around the base, the aircraft is here and we are available nationally.<br />\r\n<br />\r\nOur thoughts and prayers are with the families of the pilots in Sunday&#039;s airtanker crash in Utah.'),('dquinones','2012-06-10 16:03:17','The helicopter and remaining crewmembers are en route to Wyoming to assist with the Guernsey Fire, while the rookies finish up rappel training in Idaho. We should all meet up in a few days to put our training to the test.'),('evanhsu','2012-06-13 16:59:52','The entire crew is currently assigned to the Guernsey State Park Fire in Guernsey, WY (http://inciweb.org/incident/2909/).'),('dquinones','2012-06-15 08:01:23','The aircraft and crew are off to Douglas, WY on a new adventure.'),('dquinones','2012-06-23 09:49:41','The crew is currently on the Russels Camp Fire just outside Douglas, WY. We are assisting with helibase and field operations and working hard to help with containment in a critical fire weather environment at 9500&#039;. '),('evanhsu','2012-06-30 14:46:40','The crew is currently assigned to the Otter Creek Fire near Ten Sleep, Wyoming.  Sarah is managing our helicopter while Tim is assigned as the helibase manager.  The rest of the crew is engaged in structure protection along Otter Creek Canyon.'),('evanhsu','2012-07-03 07:04:57','The crew and helicopter are en route back to Grants Pass, Oregon after 21 days in Wyoming.  Good luck to all the crews still out there.'),('evanhsu','2012-07-08 19:36:29','And we&#039;re off again.  The crew is pre-positioned in La Grande for lightning.'),('dquinones','2012-07-10 13:42:45','The crew is staffing rappel fires in NE Oregon and the helicopter is operating out of Enterprise to support them logistically. <br />\r\nHappy Birthday wishes go out to our Engineering Department lead, Evan Leward Hsu who turns 29 today. He is currently assigned to Incident 380, so if you&#039;re in the area give him a shout.'),('dquinones','2012-07-11 14:29:13','As the work continues in NE Oregon, our equipment specialist and resident questioner Sarah Jean Uvodich is enjoying her 100th rappel and her birthday today. We hope that she is working hard and finds a little me time on the fireline.'),('dquinones','2012-07-30 15:49:16','A few boosters to Price Valley, the rest getting reset mentally and physically in GP for the next round.'),('dquinones','2012-08-01 18:06:31','The base is empty with the Siskiyou Rappellers and some Central Oregon boosters out on fires locally. Welcome to Dirty August.'),('dquinones','2012-08-05 13:01:22','4 boosters still at Price Valley, and the rest of us are cleaning up and getting ready for the incoming lightning. Sunny, hot and dry people.'),('dquinones','2012-08-09 10:07:55','After a brisk round of fire activity and rappelling in the Red Buttes Wilderness, we are back . Staffing the aircraft, assisting with helibase operations on the Siskiyou N.F. and refurbing equipment for the next mission are the goings on.<br />\r\n<br />\r\nThe SRC boosters that went to Price Valley remain on the road and engaged in operations with that program.'),('dquinones','2012-08-16 11:12:29','4 rappellers are out in the Sky Lakes Wilderness on the Cold Springs Fire, while the rest of us are at the base getting ready for the predicted lightning.<br />\r\n<br />\r\nFire weather watches for abundant lightning + dry fuels + instability= Coiled springs.'),('dquinones','2012-08-18 21:14:21','Boosters come in, boosters go out. 8 rappellers are now out on the Rogue-Umpqua Divide Wilderness and fresh orders are on the fax machine. Umpqua here we come.'),('dquinones','2012-08-21 12:47:23','The last few days have been very active, staffing fires and supporting fires on the Umpqua NF. Most of the crew is now at Tokotee Airstrip getting things back in order for whatever may come our way.<br />\r\n<br />\r\nToday the crew also took some time at this mornings briefing to discuss the tragedy of one of our fallen sisters, Anne Rosemarie Veseth. Our thoughts and prayers go out to the friends and family of Anne, and we hope that thay may find peace.'),('dquinones','2012-09-12 11:06:42','The crew (minus Fabris) is at Trout Lake, WA. helping out on the Cascade Creek fire and rappelling on the Gifford Pinchot N.F.<br />\r\nNights are cold and the fire is burning actively during the day....welcome to September.'),('evanhsu','2012-09-27 21:31:56','Our helicopter has been extended through October 7th due to continued fire weather conditions on the forest.  The crew is ready and waiting at the Siskiyou Helibase.'),('dquinones','2012-10-13 16:27:45','A couple of folks out on assignment and the rest of us are hanging at the base watching the never ending summer roll on. No rain out of this last storm, sunny and warm......another helicopter extension? <br />\r\nWe might end up staging at the pumpkin patch before it&#039;s all over.'),('evanhsu','2012-10-18 11:54:25','Fire season has officially ended in Southern Oregon.  Our helicopter left us on October 15th for another winter of heli-skiing in Canada.  The few remaining crewmembers are now cutting hazard trees and winterizing the rappel base.  Another great season has come to an end.'),('dquinones','2012-12-23 22:34:48','Grants Pass has now been added to the temp 4 and 5 positions. We are still looking to have all the applications in by December 31st with selections to follow shortly thereafter. <br />\r\n<br />\r\nGood luck and happy holidays.'),('dquinones','2012-12-27 12:44:39','The December 31st deadline for all temporary and permanent applications to be in is rapidly approaching. This is just a friendly reminder to have them in, have them correct and have a desire to work here.<br />\r\n<br />\r\nNow back to the Holidays and your regularly scheduled programming.'),('dquinones','2012-12-17 10:04:45','Well the jobs have all been posted on USAJobs, but as you can tell Grants Pass is not showing up on any of them. We are in contact with personnel to remedy this problem, so hang in there and get ready to hit send once we get this thing fixed.<br />\r\nThat is all.'),('dquinones','2012-12-17 13:53:19','The Grants Pass duty station has been added to both the DEMO and MERIT announcement for the GS-6/7 Squadleader position on USAJobs. This means that we are still on track to have all the applications in by the end of December and start the hiring process in January. Just click on the recruiting tab to get the ball rolling.<br />\r\nCross your t&#039;s and dot your i&#039;s people.'),('evanhsu','2012-11-15 23:19:43','Falling leaves and 6 hours of foggy daylight can only mean one thing: hiring. <br />\r\nWe are currently outreaching a GS-6/7 Squad Leader permanent position on the crew with a desire to fill in the next few months. <br />\r\nWe are also fielding calls and updating our contact lists for temporary employees who want to be on the crew for the 2013 field season. <br />\r\nIf you think you have what it takes, give us a call and make sure that your USA Jobs application is up to date. Referral lists for the temporary jobs will be requested in early January.'),('dquinones','2012-11-30 12:27:07','Well the votes have been counted and recounted and the results are still the same. Our friendly farmer Charles Fabris has won the honor of Siskiyou Rappel Crew&#039;s 2012 Rappeller of the Year. <br />\r\nCongratulations Charlie, you earned it.'),('evanhsu','2012-12-08 14:19:22','Seasonal job announcements for the 2013 fire season are now listed on the USAJobs website.  Get your applications in early - we will be pulling our applicant list at the beginning of January.  The announcement numbers are listed on our Recruiting page (http://tools.siskiyourappellers.com/recruiting.php).'),('dquinones','2013-01-09 08:31:46','The Siskiyou Rappel Crew would like to send our condolences to the friends and family of the flight crew that was on board the Columbia Helicopter that went down in Peru on Monday.<br />\r\nThis is a tragic loss and our thoughts and prayers are with you.'),('dquinones','2013-01-11 15:45:43','Interviews and hiring continue. We will be requesting a qualifications check on Monday the 14th to move forward with filling the 2013 roster. If you have the skills and desire to be on the crew, time is running out to put your best foot forward.<br />\r\n<br />\r\nDon&#039;t be left behind.'),('dquinones','2013-01-22 15:28:44','We have completed the temp hiring for the 2013 field season with job offers being accepted and the roster updated bringing our numbers to 21. If you did not receive an offer for this season, we appreciate your interest in our program and recommend that you keep in touch throughout the year and get your app ready for the fall.<br />\r\n<br />\r\nSee you on the line.'),('dquinones','2013-02-13 16:25:08','We have received the referral list for the GS-6/7 lead crewmember position and are actively going through all the applications. We expect to have made a selection by March 5th and to have the candidate in place by early April.<br />\r\nIf you applied for the position and wish to be considered, pick up the phone and give us a call. '),('dquinones','2013-04-25 16:02:27','We are pleased to announce that we have filled 2 GS-6/7 Lead Crewmember positions on the Siskiyou Rappel Crew, and the selected individuals are in place and working hard.<br />\r\n<br />\r\nJonah Gladney comes to us from the Redmond Smokejumpers and has a strong fire background to include smokejumping and hotshots. His impressive fire experience, operational mindset and solid work ethic will make him an excellent addition to the program and the region.<br />\r\n<br />\r\nBrett Ballard comes to us from the Grangeville Helitack crew and brings an energetic personality and a strong fire background as well. He has also spent time working with the Blue Mountain Rappel Crew so the transition will be a seamless process, and we look forward to his fresh ideas to keep us motivated and moving forward.<br />\r\n<br />\r\nBoth of these individuals expressed a strong desire to be on this crew and work on this forest for the diversity, the  ability to affect change and to bring families closer together. Those are the foundational building blocks of this program, and the crew is excited to have them in place and doing work.<br />\r\n'),('dquinones','2013-04-29 20:01:16','All the vets and permanents (minus Gladney, Holloway and Taylor) are braving the elements in John Day, OR. Re-certification is the name of the game and some are moving on to live rappels tomorrow at Snow Shoe Helibase, while others get introduced to the tower and mock ups.<br />\r\n<br />\r\nRookie training is in our near future.....'),('dquinones','2013-05-06 06:03:41','Day one of rookie training, time to walk the talk.'),('dquinones','2013-05-20 10:22:53','Rookie week and field week are in the books with S-271 aviation training in the works this week. All the rookies are holding steady up to this point.'),('dquinones','2013-06-02 08:58:12','Well, the rookies have all passed the Siskiyou rookie training program. The entire crew is now en route to Salmon, Idaho to get the rookies certified to rappel, help with the training and to meet up with our aircraft for the 2013 fire season.<br />\r\n<br />\r\n1 more week until game on.'),('dquinones','2013-06-11 10:34:13','All the rookies have passed their rappel training, and the entire crew is en route home and ready to fight fire.'),('evanhsu','2013-06-13 15:03:47','Quinones + 8 are now assigned to the Daves Fire in California.'),('dquinones','2013-06-13 18:26:24','The helicopter and 8 Rappellers are assigned to the Daves Fire in California. Helibase duties, bucket work and line assignments for the crew are currently ongoing.'),('dquinones','2013-06-15 14:48:04','After a short roll in R-5, the crew is en route to Utah. It&#039;s begun.'),('dquinones','2013-06-17 10:18:30','Lyda and the rest of the gang are en route to Moab Utah to join up with the aircraft and crew on the Lackey Fan Fire. A 2 day drive should get the to the land of no shade.'),('dquinones','2013-06-20 11:52:25','The crew has been reassigned to the Wild Rose fire in Rangely, CO. Pretty calm so far, but we remain vigilant while adapting to our new micro meteorological environment....'),('dquinones','2013-06-26 20:00:20','Time to get your cowboy on, the crew is now in Laramie, Wyoming for IA.'),('dquinones','2013-06-30 21:19:40','Our thoughts and prayers go out to the friends and family of the Granite Mountain Hotshots as we anxiously await more news.'),('dquinones','2013-07-03 14:37:28','The crew now has a Type 1 Sikorsky S-61 in our fleet that is currently helping out with all the lightning fires in the Vale, OR area. <br />\r\nThe rappel aircraft and crew are en route from Laramie, WY to enjoy all the blazing temps that Grants Pass has to offer. It&#039;s a dry heat.'),('dquinones','2013-07-10 10:49:17','La Grande, Oregon calls so we answer. '),('dquinones','2013-07-15 12:04:52','The crew is regrouping after a short stint in Northeast Oregon, and is now converging on the Mother Land that is Central Oregon. IA load is at the ready, while 8 are working hard to get a handle on the Buck Springs fire. <br />\r\nEvan and Nick are still rolling with the Type 1 even though it looks to be heading back to GP.<br />\r\n<br />\r\nFires, rappels and predicted lightning are keeping us all busy.'),('dquinones','2013-07-22 09:55:37','19 rappellers are currently at Grants Pass enjoying the sunny, hot and dry weather.'),('dquinones','2013-07-26 18:43:24','The crew and numerous ground and air resources are currently engaged in fighting fire on the Rogue River- Siskiyou NF. Weather, dry fuels and tough terrain are making us earn it.<br />\r\n<br />\r\nStay tuned....'),('dquinones','2013-08-03 16:26:09','The crew is scattered across the Willamette NF on multiple lightning fires. Jonah is on a TFLD assignment, Brett is managing our type 1, and 4 boosters are still on the road in R-1.<br />\r\nWe are rappelled out.'),('dquinones','2013-08-03 16:26:10','The crew is scattered across the Willamette NF on multiple lightning fires. Jonah is on a TFLD assignment, Brett is managing our type 1, and 4 boosters are still on the road in R-1.<br />\r\nWe are rappelled out.'),('dquinones','2013-08-09 19:18:27','The crew has been heavily engaged in IA on the Willamette, Umpqua and Rogue River-Siskiyou National Forests.<br />\r\nBrett and Sarah are tag teaming the Type 1 duties and Jonah has moved up to DIVS(t) on the Big Windy Fire.<br />\r\nThis is the 8th consecutive day that we have emptied the base, and there is more lightning happening right now on the forest.<br />\r\n<br />\r\nAugust is so dirty.'),('dquinones','2013-09-05 14:13:41','A few crew members are out on single resource assignments while the rest of the gang is awaiting an assignment from Grants Pass. Lightning is on the forest and we are ready, but only time will tell.'),('dquinones','2013-09-13 18:42:26','Sunny hot and dry, fire season continues with one more round of emptying the base on the Siskiyou&#039;s.'),('dquinones','2013-09-24 14:51:47','According to the USFS, the ODF and the weather outside....fire season is officially over in SW Oregon. Project work, base clean up, training and staying dry are now the focus.'),('dquinones','2013-10-21 14:49:24','The temps are all off for the season and doing what they do in their natural environment, while the permanent staff holds down the fort and un-furloughs the base. <br />\r\n<br />\r\nCongratulations are also in order for our Rappeller of the Year, Richard Andrew Larrimore! Right on Larry.'),('dquinones','2013-10-30 16:21:05','As things quiet down and the cooler weather starts to roll in, we turn our attention to hiring for the 2014 season. We look to make job offers the 2nd or 3rd week of January, so get your application in early and set up an appointment to come by the base while we&#039;re still around.'),('dquinones','2013-11-18 10:01:33','If you are interested in applying to the crew for the 2014 field season, you have roughly 1 month to get your application in and stop by the base for a tour. Keep checking the recruiting tab often as this is also the time when the OCR numbers may change or be updated to replace the currently listed ones that show an end date of November 29, 2013.<br />\r\n<br />\r\nQuestions in text format? Call us.<br />\r\nVisual learner with questions? Stop by the base.<br />\r\n<br />\r\nGood luck with your decision.<br />\r\n'),('dquinones','2013-12-16 12:55:47','The hiring process continues and we look to have the updated job announcements posted in USA Jobs after the first of the year for your reading enjoyment. If you have any questions, call or stop by the base. Otherwise keep an eye out for the updates on the web and the recruiting page of our website.'),('dquinones','2014-01-06 13:35:04','Hiring Update:<br />\r\n<br />\r\nAs of this morning, we have requested an announcement number to be generated for the 2014 temp hiring and should be receiving it shortly. Once we have the number in hand we will post it in the recruiting section of our website and be making calls to those we have been in contact with. <br />\r\n<br />\r\nKeep an eye and ear out.'),('dquinones','2014-01-08 17:10:28','The outreach for the PSE 13/13 GS-4/5 Senior Firefighter position is out and we should have it posted on USAJobs by the end of the week if all goes well. We are looking to potentially fill 2 positions on the crew and have already received good interest.<br />\r\n<br />\r\nIf you are interested in applying, come prepared and ready to work.'),('dquinones','2014-01-18 10:37:12','The announcement numbers for our temporary GS-4/5 positions are now on USAJobs for your viewing and applying pleasure, and are also on our recruiting page. The announcements close January 23rd at midnight (EST), so hopefully you have all your documents ready to hit the send button. If you need assistance, give us a call and we will guide you down the path to the Siskiyou&#039;s!<br />\r\n<br />\r\nGood luck.'),('dquinones','2014-01-28 10:48:11','We are still waiting for Grants Pass to be added to the GS-5 Senior Firefighter position as a duty station and are hopeful that it will be completed this week. Keep an eye out and make sure your application is complete as we will be requesting a referral list approximately 10 days after it shows up on USAJobs.<br />\r\nThat is all.'),('dquinones','2014-01-28 16:03:45','**GS-4/5 Update**<br />\r\n<br />\r\nThe announcement number for the permanent 13/13 GS-4/5 Senior Firefighter is now showing Grants Pass as a duty station in USAJobs. We will be requesting a referral list on Tuesday February 12th to continue the hiring process.<br />\r\n<br />\r\nGame time.'),('dquinones','2014-02-21 14:32:38','We have made the decision to not have a rookie class for FY14 due to the limited amount of turnover we are experiencing. We do however encourage you to keep in touch throughout the field season if you are still interested in employment to keep your foot in the door for FY15.<br />\r\n<br />\r\nWe are also still awaiting our GS-4/5 Senior Firefighter list which should be here by the first part of next week. We hope.'),('dquinones','2014-02-26 15:38:30','We have finally received the GS-4/5 Senior Firefighter list and are in the process of evaluating the applicants. We should have a decision to forward on to the Regional Office in the next 2-3 weeks.'),('dquinones','2014-03-17 13:40:21','The selection for our GS-5 Senior Firefighter is at the Regional Office for final approval and we are looking to have a decision from them this week. '),('evanhsu','2014-03-27 16:28:39','Albuquerque is doing a final quals check on our GS-5 selection and has notified us that we should be able to make our job offer on Monday, March 31st.'),('dquinones','2014-04-02 10:21:54','Congratulations to Andrew Larrimore on becoming our new GS-5 Senior Firefighter in our Operations Department. Andrew has worked hard to obtain his qualifications, has a great attitude and is dedicated to our program. Those qualities will take him far and we welcome him to the crew on a more permanent basis.'),('dquinones','2014-04-08 10:12:01','With support from the Rogue River-Siskiyou N.F. the crew is expanding our permanent workforce. We have recently added an apprentice position on the crew and it has been filled with Jessica Crump from the Gold Beach Ranger District. Jessica has completed her hours as an apprentice and has been converted into this new developmental position on the crew as a GS-5 Senior Firefighter and will assist us with administrative duties as well as supporting all departments to round out her knowledge base. <br />\r\nHer strong work ethic, excellent physical fitness level and desire to learn have given her the foundation to succeed in this position and we welcome her to the crew.'),('dquinones','2014-04-08 10:19:22','In the next 2 weeks we say goodbye to Sarah Uvodich and wish her well in her new position on the High Cascades Ranger District of the Rogue River-Siskiyou N.F. as their Prevention Technician. Sarah has been on the crew as our GS-5 Senior Firefighter in the Equipment Department for some time now and her knowledge, professionalism and dedication to the program will be missed. We know that she will do great in her new position and are glad that she will remain within reach on the forest.<br />\r\n<br />\r\nThis vacancy will also open up another opportunity for interested individuals in the coming months. We look to outreach for this opening this field season with an intent to fill this fall. Detail opportunities may also be available this season, so if you are interested give us a call.'),('dquinones','2014-06-03 17:01:45','This past weekend we said farewell to our Fire Staff Kevin Donham and wished him well in his retirement. It was/is a big loss for the forest and the fire community, but we move on as fire season waits for no man.<br />\r\n<br />\r\nSpeaking of fire season, it has been officially declared in SW Oregon as of yesterday and the wind and heat are backing that up. It looks to be another dry one, but we are ready with the helicopter on the pad and a bustle of activity in the background as we fine tune things.<br />\r\n<br />\r\nSee you on the line. '),('dquinones','2014-06-22 14:23:51','Some small ODF fires have kept us tuned up while Hsu and Hastings take on HMGB duties at the Bryant Fire. So far things have been extremely dry and quiet, which can only mean 2 things for the future.<br />\r\n<br />\r\n1. We will get fires<br />\r\n2. We will not get fires<br />\r\n<br />\r\n'),('dquinones','2014-06-30 14:50:57','A moment of silence for the Granite Mountain Hotshots to start the day off, followed by a briefing with lightning in the forecast and a noticeable increase in temperature made us take pause. Quality communication and info sharing is the focus today as we continue to prepare ourselves for the potential event. <br />\r\n<br />\r\n&acirc;€œEsse Quam Videri&acirc;€'),('dquinones','2014-07-09 09:44:05','It is so sunny, hot and dry that it has scared all the thunderstorms away. Single Resource assignments aside, all is quiet.<br />\r\n<br />\r\nEnd of report.'),('evanhsu','2014-07-13 22:13:17','Shave that mohawk, Hastings!<br />\r\nIf you&#039;re trying to get ahold of Crump, Hesseling, Ormond or Hastings you might have to try back in two or three days.  We just dropped them off in the Willamette with fire underfoot and no maps.'),('dquinones','2014-07-20 13:19:00','The crew has been very busy on the Willamette National Forest helping out with the Bingham Complex both at the helibase and on the line. Initial attack fires were plentiful but large fire support is now the mission with the Santiam Helibase supporting the Bingham, Lizard, Bridge 99, Bear Butte and Logging Unit fires. <br />\r\n<br />\r\nTrainees are all over the place.'),('dquinones','2014-07-22 13:18:57','In the past 2 days at Santiam Helibase, we have had a moment of silence for TJ Marovich, Shane Allen and Jeff Heath who were all fatally injured doing a job we all love to do. We also had the privilege of hearing a first hand account of the Iron 44 helicopter crash from a helicopter crewmember who was at the helispot when the aircraft went down. With the anniversary of the Andy Palmer incident just days away, we have taken some time to reflect and prepare further to honor their memory and learn from our past. <br />\r\nWe have a long season ahead of us still, take care of each other and never forget.'),('evanhsu','2014-07-24 13:38:13','We&#039;ve moved to Oakridge and are currently staffing one fire on the Willamette with 4 hraps (Hastings, Crump, Favorite &amp; Ormond).  The aircraft is now quietly awaiting an order of boosters as the weather heats back up...'),('evanhsu','2014-07-24 13:43:34','Six of our crewmembers have been positioned in Prineville on a boost to the Central Oregon Rappel Crew -  if you&#039;re looking for Sailer, Bobic, Johnson, Gladney, Olsen or Fabris you&#039;ll find them on the Deschutes National Forest...'),('evanhsu','2014-07-31 12:01:46','We have now logged 22 rappel operations in the past two weeks.  Fire activity has been extremely high on the Rogue-Siskiyou National Forest with over 30 active fires being prioritized and staffed as firefighters become available.  Currently in the field: Mayfield, Holloway, Hastings, Crump, Johnson &amp; Fabris staffing the Wagner #1 Fire - Ormond &amp; Larrimore staffing #717 on Winburn Butte near Ashland - Quinones is ICT3 of the Camp Creek Complex - Gladney, Sailer, Bobic &amp; Olsen still assisting the Central Oregon Rappellers out of Prineville, OR.'),('dquinones','2014-08-13 10:43:55','We have been staying ahead of the lightning with a robust rappeller recycling program, and with the recent weather we may even get a slight respite. 6 on the Umpqua, 4 on the Siskiyou&#039;s and 4 in the hole with just over 5,000 strikes in Oregon....we got this.'),('dquinones','2014-08-18 15:22:20','Boosters to Central Oregon, Mayfield cruising around Siskiyou Mountains in a Type 3, 2.5 loads in the Sky Lakes Wilderness and 3 MRC boosters on the last load.......clock work.'),('dquinones','2014-09-01 08:47:44','Most of the crew has returned from the #790 fire after some hard fought days and long nights and are now at Prospect Helibase supporting the effort. A lot of hard work and planning went in to that fire along with an extensive para-cargo ordering process to get the edges locked in. 4 rappellers remain on the line in ghost mode, doing whatever they can to assist further.<br />\r\n<br />\r\nBoosters at Central are rumored to return soon, along with a few on well deserved R&amp;R.  With the Happy Camp Complex column in the background, we clean up our gear and realize it ain&#039;t over yet.<br />\r\n'),('dquinones','2014-09-17 04:52:45','We have finished up with the #790 Fire and have now moved on to the Onion Mountain Fire. Initial attack with rappellers was our first shot and with the foothold it has in very steep and rugged terrain, we are now assisting with personnel in Operations, at the Grants Helibase and in the field gathering intel. Boosters from all over are supporting us as well to ensure that we are ready for any additional IA that could arise. <br />\r\n<br />\r\nIt has been a long summer with tons of productive work to keep us occupied and further our skills.<br />\r\n<br />\r\nOn a more personal note, Everett Hsu was brought into this world by his mother Mary and his father Evan on September 16, 2014 at 1902. We are extremely proud to have another member of the family and we all look forward to hanging out with him and teaching him bad habits when things slow down. <br />\r\n<br />\r\nCongratulations to Mary and Evan!'),('dquinones','2014-09-23 20:34:31','Our thoughts and prayers go out to Wally Ochoa, his family and the Winema Hotshots. Wally was struck by a snag and is in the hospital surrounded by his family and friends. <br />\r\nWe are confident that this will only be a speed bump for Wally and that he will be leading the saws up a knife ridge with a smile on his face real soon.<br />\r\n<br />\r\nHere&#039;s to your speedy recovery Wall, the baddest Sawyer I ever met.'),('dquinones','2014-11-21 15:15:22','The outreach for our vacant GS-4/5 Senior Firefighter is now on the street and available for viewing. Get your app ready and give a call if you have questions, the list will be requested on December 16th.<br />\r\n<br />\r\nhttps://fsoutreach.gdcii.com/Outreach<br />\r\n'),('dquinones','2014-11-21 15:56:49','Congratulations to the 2014 Siskiyou Rappel Crew Rappeller of the Year, Tanner Ormond! '),('dquinones','2014-12-17 14:45:05','The referral list for the GS-4/5 Senior Firefighter position has been requested and we will be starting the hiring process soon.  Hopefully you have your app in and have contacted the base.<br />\r\n<br />\r\nGood luck.'),('dquinones','2015-01-06 15:49:16','Our temporary job announcements have opened up in USAJobs and are linked on our recruiting page for your clicking enjoyment. It is also not too late to drop by the base for a face to face and get a feel for things, so give us a call to schedule a time.<br />\r\nThe closing date is January 12th for both the GS-4 and GS-5 so get on it.'),('dquinones','2015-01-21 10:26:19','We have received our GS-4/5 Senior Firefighter 13/13 list and are diligently working on it. Up to 4 candidates will be selected to be on the crew with start dates hopefully in the next few months. '),('dquinones','2015-02-22 08:17:48','The selections have been made for our four GS-4/5 Senior Firefighter positions and have also been approved by our Forest Supervisor. Notifications should go out shortly from ASC with expected start dates of April 1st.<br />\r\nThis will conclude Phase 1 of our hiring plan and if all goes well, Phase 2 should take place in 2017 with the addition of 3 more Senior Firefighters on the roster.<br />\r\n<br />\r\nTemporary hiring has been completed for the upcoming season, as well as our deadline for accepting detailers. The list is set and we will have 22 on the up list for whatever may come our way.'),('tlyda','2015-03-11 09:49:12','Just a quick update as time is getting closer to the 2015 Fire Season,  I want to Congratulate our new GS-5 Seniors, E.J. Brooks, Gregg Reidelbach, Justin Holloway and Charlie Fabris,  So all the hiring has been completed and we are 22 strong for this year .Thanks again to all that applied for the perm and temp jobs.'),('evanhsu','2015-06-12 07:27:44','Fire season is off to a running start!  Rookies have already logged 2 operational rappels and we&#039;ve staffed 5 fires, including ICT5, ICT4 and ICT3 incidents.  We are currently hosting 5 additional aircraft at our helibase and are providing logistical support for a number of fires in the area as well as covering initial attack with the help of the Malheur Rappel Crew and 0WW.'),('evanhsu','2015-06-20 08:21:09','The commotion from our last lightning bust has subsided and we&#039;ve begun sending some folks out on assignments to Alaska and the Buckskin Fire.  In preparation for the next round of lightning, we&#039;re researching mobile GIS technology and real-time location sharing to improve IA intel, raising our equipment stocking levels, and as always... training.  We&#039;re ready for a busy summer.'),('dquinones','2015-07-04 13:44:43','Sunny, hot and dry on this 4th of July with BBQ and standby on the menu.<br />\r\n<br />\r\nMerica!!'),('evanhsu','2015-07-09 07:20:57','The past week has been busy for the crew, logging 6 fires in 7 days on 3 different forests.  We still have a handful of folks out on single resource assignments with 1 in Alaska as an EMT, 1 in Washington as an engine boss, 1 out as a crew boss, 2 managing our Sky Crane, and 1 as an ICT4 on the Buckskin fire.  More lightning is predicted this week as our firefighters trickle back to the base from their fires...'),('dquinones','2015-07-30 18:35:17','Fires to the South and columns in view from the base combined with a Haines 6 and 110 degree heat. It&#039;s coming.'),('dquinones','2015-08-01 09:29:10','Rappellers on the Klamath NF and Brown Mountain, Wenatchee boosters leaking coconut oil on our flight steps and another boost order in the hopper. With the forecasted weather for today being LAL 6, 105 degrees and 10% RH, the guys in the field are struggling to keep their fires in check and we are supporting them from the base logistically.<br />\r\n<br />\r\nWe received word that there was a fatality on the Modoc on July 30th and our condolences go out to the family and friends of our fallen brother.<br />\r\n<br />\r\nWork hard and take care of each other.'),('dquinones','2015-08-01 18:50:17','Current Status:<br />\r\n<br />\r\n 4 rappellers on the Granite Fire on the Klamath NF, 4 on the Brown Mountain West Fire, 4 on the Strickland, 1 in Alaska with the Rogue River Hotshots, 1 on the Colville as ABRO(t), 1 in Spokane as ENGB(t), 1 on the Willamette as ASGS(t), boosters from John Day are en route and a Check Spotter is on order so Ballard can strut his stuff.<br />\r\n<br />\r\nOur Type 2 aircraft is supporting fires on the Siskiyou Mountains Ranger District and our Type 1 aircraft is on the Cable Crossing Fire.<br />\r\n<br />\r\nLightning is currently on the forest.'),('dquinones','2015-08-03 09:13:06','We have rappelled out the last 3 days and today is not expected to be any different. 70 fires on the forest, Type 3 team in-briefing today and unstaffed fires on all districts. Additional booster orders are in and we are heading to the Gold Beach Ranger District this morning.<br />\r\n<br />\r\nFirst Load!'),('dquinones','2015-08-06 14:38:11','Day 6 of no rappellers available with heavy IA on the forest and supporting existing fires logistically.<br />\r\n<br />\r\nCongratulations go out to Brett Ballard for becoming our newest qualified Spotter. His first task after working so hard to attain his new qual? Give Tim Saturday off.<br />\r\n<br />\r\nSpecial thanks to Mike Davis for taking the time to give Brett a look.<br />\r\n<br />\r\nCasey Woodward is now in the hot seat with Mad Dog working towards his Spotter certification as well and lightning is in the forecast for tomorrow. Good luck Casey.'),('dquinones','2015-08-20 16:40:42','We have been assisting with the firefighting efforts, mainly in SW Oregon, for some time now. We have SRC personnel on the Collier Butte, Stouts, boosters in Central Oregon and a small contingent of IA rappellers at home. Both aircraft have been busy with all sorts of missions helping the forest hold on to what we have.<br />\r\n<br />\r\nIt is a drastically different situation in some other areas however, with large fires pushing multiple GACC&#039;s to PL5 and creating surge forces due to critical resource shortages. <br />\r\n<br />\r\nWe join others in mourning the loss of 3 of our own and are thinking of those that are fighting the big ones.<br />\r\n<br />\r\nAnd we still have potentially 2 more months of fire season still ahead of us.......'),('dquinones','2015-09-14 13:55:49','The fires have come, have gone and have lingered depending on their location. The crew has been active, primarily in SW Oregon, for the last several weeks. The Collier Butte Fire and the National Creek Complex have been getting the majority of their attention with some rappel fires in between. Several crewmembers are out on single resource assignments to help the national effort and to advance their training.<br />\r\n<br />\r\nThere has been some pretty exciting fire behavior on incidents within our region and now it appears that it is California&#039;s turn in the spot light. We stand behind all the firefighters actively engaged on these incidents and look forward to raising a glass with you here soon. <br />\r\n<br />\r\nFor now, think ahead, work hard and look out for each other.......Omnis Cedo Domus.'),('dquinones','2015-10-27 09:57:10','Sunny, hot and dry conditions have given way to cool temps and intermittent rain across SW Oregon. Our rappel aircraft has been released, but our Type 1 is still on contract in California, who has yet to see the relief in the weather.<br />\r\n<br />\r\nHiring preparations, training, instruction and administrative work is now the focus as we go in to the &quot;off season&quot;. <br />\r\n<br />\r\nThe votes are also in for our Rappeller of the Year, with Evan Hsu taking the title. Evan has done solid work for the program this season and it did not go unnoticed by his peers. Snaps for E!'),('dquinones','2015-12-10 15:45:23','Congratulations are in order for our very own Justin Holloway who has decided to move on to bigger and better things. He has accepted a position in Boise, Idaho as a purchasing agent which will put his college learnings to good use. We wish him all the best in his new venture, he will be missed around the base. <br />\r\n<br />\r\nThanks for hanging with us kid.'),('dquinones','2015-12-18 12:07:50','**HIRING UPDATE**<br />\r\n<br />\r\nCurrent Vacancies:<br />\r\n<br />\r\nTemporary Seasonal 1039:<br />\r\n<br />\r\nThe seasonal hiring process for the 2016 fire season has begun with the vacancy announcements for both the GS-4 and GS-5 positions closing on the 7th of December. Now that all the applications are in, we are coordinating within the region in preparation of the regional hiring session to be held in the Eugene, OR area in mid to late February with selections being made in early March. As of now, all dates are approximate so sty flexible.<br />\r\n<br />\r\nSince this will be a regional hiring effort, be specific on where you want to work and contact those programs early and often to ensure your best chance.<br />\r\n<br />\r\nPermanent GS-4/5 Senior Firefighter:<br />\r\n<br />\r\nWe are currently outreaching for two Senior Firefighters on our crew with an intent to fill in the Spring of 2016. The outreach announcement will remain posted on the Outreach Database for 14 days after a specific 7 day outreach is completed for the forest. We anticipate the vacancy will be posted on USAJobs on the 21st of December with a referral list being requested on January 5th and hiring of both positions to begin directly after.<br />\r\nIf you have an interest in these highly competitive positions, contact the base ASAP to get your name known and schedule a visit.'),('dquinones','2016-01-04 12:04:45','**Hiring Update v2.0**<br />\r\n<br />\r\nPermanent GS-4/5 Senior Firefighters:<br />\r\n<br />\r\nWe are currently looking to fill two Senior Firefighters on our crew with target start time to be in the Spring of 2016. We anticipate the vacancy announcements will be posted on USAJobs on or around the 6th of January with a referral list being requested after we complete a 10 day outreach being posted on the Outreach Database.<br />\r\nIf you have an interest in these highly competitive positions, contact the base ASAP to get your name known and schedule a visit.'),('dquinones','2016-01-06 09:35:29','The perm vacancies are now posted on USAJobs with a closing date of January 15th at midnight. Good luck.<br />\r\n<br />\r\n16-FIRE-213730G-DBS Government Wide<br />\r\n<br />\r\nhttps://www.usajobs.gov/GetJob/ViewDetails/425728100<br />\r\n<br />\r\n16-FIRE-213730DP-DBS Demo<br />\r\n<br />\r\nhttps://www.usajobs.gov/GetJob/ViewDetails/425728300'),('dquinones','2016-02-10 15:34:17','We have received our referral list for the GS-4/5 SRFF positions we have vacant on the crew and are working to make selections this week. We will also be starting our temp hiring process next week as part of the consolidated R-6 fire hire in Eugene, OR.\r\nWe have received great response to both hiring venues and encourage all the firefighters out there to keep in shape and keep in touch. Snow pack or not, it&#039;s coming.'),('dquinones','2016-03-03 14:59:38','The selections for temporary employment on the crew have been made for the 2016 field season. If you received an offer, get ready to show that you earned your spot. If you did not get an offer, feel free to call the base and get some feedback on how you can be more successful in the future.\r\n\r\nThe permanent selections have been made and we are waiting for ASC to process the final documentation. Thanks to all who applied to our program.'),('dquinones','2016-04-06 16:03:56','Well, we have good news and bad news. First off, we would like to congratulate Andrew Hastings and Tanner Ormond on their new positions on the crew as our new GS-5 Senior Firefighters. They both have strong fire backgrounds and are moving rapidly in their aviation and fuels careers as well.\r\n\r\nOn the other side, we have Evan Hsu moving on to &quot;branch out&quot; in the IT field and the private sector. He has been a long standing member of the Forest Service aviation community and has a well recognized name locally, regionally and nationally. He will be greatly missed and we wish both him and his family well in their new endeavors.\r\n\r\nBrett Ballard is also taking a detail to the Sled Springs Rappel Crew as the Assistant Foreman for the summer and his family will be in tow. We wish him well and hope that he returns with new found knowledge of fire and aviation management, as well as prime hunting locations.\r\n\r\nJessica Crump will be cracking silk over the Gila this summer on a detail as well. She will be trying out (and succeeding) for the Redmond Smokejumpers and earning her wings with an SRC rope in her pocket. Best of luck girl!\r\n\r\nReaders Digest? The crew has had great retention to date and is now in a state of flux with folks looking to move up and out to advance their skills and knowledge. This will bring another round of hiring and detailers to fill in behind along with some assistance from outside resources, but will not slow us down. \r\n\r\nSee you on the line.'),('dquinones','2016-05-04 09:18:44','The rookies have started, and are making their way through their training as we speak.....rain or shine.\r\nCrump is off to Redmond to begin her rookie training on Monday and congratulations go out to Michael Bobic, who has accepted a perm position as a Senior Firefighter on the Deschutes hand crew.\r\n\r\nIt&#039;s been a good week.'),('dquinones','2016-06-10 10:57:08','Well, rookie training and rookie rappel training are complete. All of our rookies passed and are geared up, ready to fight fires alongside the rest of the crew. They worked hard, earned their spot and we welcome them to the foal.\r\n\r\nWith that being said, training is not over. Task books and mentoring now come in to play and we are excited to see what they can do and what we can learn from them.\r\n\r\nSee you on the line.'),('dquinones','2016-06-30 17:45:45','The rookies have burned their ropes on their first operational rappel of the 2016 season. 8 acres on our lovely Gold Beach Ranger District called for two loads of Siskiyous&#039; finest and they rose to the occasion. Sunny hot and dry weather is upon us, and we now wait quietly as we attempt to avoid the poison oak wafting through the air.....'),('dquinones','2016-07-07 16:19:13','Cooler temps in the forecast through the weekend have paved the way for S-230/231 class and project work. The Type 1 aircraft has been making the rounds and allowing us to cycle HMGB trainees through to keep things going.\r\n\r\nOtherwise? We wait.'),('dquinones','2016-07-13 15:55:38','We are working with ASC to obtain a vacancy announcement for our vacant GS-6/7 Squad Leader position(s) that have been outreached. The goal is to have the hiring completed in the next month to fill the vacancy/vacancies we have on the crew. Keep an eye out for these opportunities on USA Jobs as we will be advertising for 5 days once populated.\r\n\r\nGood luck and give us a call at the base if you have any questions.'),('dquinones','2016-09-01 17:17:20','We have received the draft vacancy announcement for the 2 vacant GS-6/7 Squad Leader positions on the crew that will tentatively be advertised September 6-12. These are looking to be highly competitive, so read the announcement entirely and ensure that you attach all the requested documentation to be considered. We will post an update on this as things progress.\r\n\r\nWhile you are brushing up on your writing skills, the rappel aircraft and crew are still coiled springs on the Pioneer Fire in large fire mode. Single resource assignments on the line and logistical support are the daily operations along with a large IA response area should we get &quot;just one good lightning&quot;.\r\n\r\nThe Type 1 is in Baker City on the Rail Fire assisting with containment efforts and prepping for next season in between ABS entries.\r\n\r\nGregg Reidelbach has moved over the the Detroit hand crew on the Willamette for a temporary promotion for the remainder of the season.\r\n\r\nJonah Gladney has accepted a promotion to a new job on the same crew, his leadership, sewing ability and entire family will be missed. Congrats Jonah, show hard.'),('dquinones','2016-09-08 14:02:52','We are still waiting for ASC to provide us a vacancy announcement for our vacant GS-6/7 Squad Leader positions.......hang in there.'),('dquinones','2016-09-12 15:52:48','The announcement for our 2 GS-6/7 Squad Leader positions is finally set to hit the streets of USAJobs on 09/13/2016 and close on 09/22/2016. They are being flown MERIT and are 18/8 positions with a duty station of Grants Pass, OR.\r\nThe link below will get you to the vacancies, and be advised, Grants Pass is in R6 and not R8......fun fact.\r\n\r\nGood luck.\r\n\r\nhttps://www.usajobs.gov/GetJob/ViewDetails/450299800'),('dquinones','2016-09-29 18:23:10','We have received the referral list for our vacant GS-6/7 Squad Leader positions and will be working through the process over the next several days. Stay tuned and give us a call if you have questions.'),('alarrimore','2016-10-28 15:02:01','The votes are in. 2016 Siskiyou Rappeller of the Year goes to Gold Beach native James Taylor! Well played James. '),('dquinones','2016-10-28 15:47:18','Lay off season is here with the last of the perm staff exiting the arena today. Things will be quiet, but the behind the scenes action is ongoing......and relentless.\r\n\r\n'),('dquinones','2016-10-31 18:19:51','Just an update on upcoming hiring.\r\n\r\nFire Hire Timelines:\r\nï‚· October 1st-October 31st Regional outreach for all fire positions in R-6\r\nï‚· November 1st-November 15th vacancies open in USA JOBS\r\nï‚· January 21st-January 30th Subject Matter Expert (SME) application review\r\nï‚· January 30th- February 9th Recommendation / Selection weeks');
