0.0000,0,0.0000,0.0000,'http://www.google.com/calendar/feeds/default/private/full/mlsasakvjs19iu2ppgka9b00rg/63512006823'),(133,'2013-07-26 00:00:00','wf','or-med-000999','big windy 4','hs62','1502',1.00,5,'2,3,4','ODF state assist for one shift. Also known as the Ridge Fire to MICC.',42,38.0000,21.0000,-123,45.0000,33.0000,'http://www.google.com/calendar/feeds/default/private/full/luo6omm65b272ab5amt5ce0f2k/63512007629'),(134,'2013-08-02 00:00:00','wf','or-wif-000087','sphinx lake','p6ek2r','0618',0.30,5,'3,4','Upper slope fire burning in duff and dead/down timber. lightning caused and was able to identify 4 different strike trees. fire was on a north aspect  on the upper third . Due to the steep slope and amount of mop up I requested additional rappellers to assist.',44,4.0000,531.0000,-121,53.0000,400.0000,'http://www.google.com/calendar/feeds/default/private/full/e9pqf59ode4lpme9hpfktb6jao/63516516665'),(135,'2013-08-01 00:00:00','wf','or-rsf-130426','labrador','p6hsq5','0610',1000.00,2,'3,4,5','',0,0.0000,0.0000,0,0.0000,0.0000,'http://www.google.com/calendar/feeds/default/private/full/gllrhhlnbib35dfuugofdkeseg/63518667330'),(136,'2013-08-10 00:00:00','wf','or-rsf-130570','border fire','p6ek2j','0610',0.80,5,'1,2,5','Upon the first load (McCarthy, Hesseling, Favorite and Esh) orbiting the fire. It appeared to be bushy sparsely scattered fuels with pockets of dense manzanita brush and a few trees on both the west and north east flanks; those of which that were the priority areas. IC5(q) McCarthy asked for one more full load of rappellers (Campbell, Holloway, Crump, Mayfield) to assist once getting on the ground and sizing up the incident. McCarthy also made the decision to order a type 1 or 2 helicopter in the area to provide water drops/bucket support and a full compliment of 2 IA boxes and 1 saw box for each full load of rappellers staffed. Mayfield and Favorite were given the orders to use the chainsaws and start on opposite flanks (Favorite on the west and Mayfield on the east) and proceed to brush cut through the manzanita and meeting in the middle, to make scrapping line more easily accessible for the other rappellers. Helicopter 30G (type 2 UH-1H) arrived on the fire with only enough time and fuel to provide 5 bucket drops cooling the priority areas substantially making it more readily accessible for the rappellers to start cold trailing and searching out smokes (3 to the west flank and 2 to the NE side). The forward rate of spread was stopped at 20:00 with a containment of 20% lined. Further efforts finalized the fire being 75% lined by the time the crew was ordered at 00:30 to pull off, eat something and get some sleep before next shift starting at 06:00. The next morning the crew was briefed that IC5 command was being handed over from Kevin McCarthy(COR) to IC5(t) Hesseling(SRC). Hesseling briefed the crew, delegated orders and priority jobs for the day to crew members and notified dispatch on the switch as well as a fire update. Roughly around 11:00 IC5(t) Hesseling was notified by HECM(Q) Mayfield that both Favorite HECM(t) and Esh(COR) HECM(t) had finished constructing a helispot for either a type 2 or type 3 agency helicopter. Longitude and Latitude coordinates were given. Hesseling then updated dispatch around 12:00 with a fire update that it was now 100% lined and coordinates for the helispot were relayed as well as letting them know that it still needed to be approved by a helicopter manager. The orders of demobbing that day were given and accepted @ 14:00. Hesseling delegated orders for crew members to start packaging up personal gear as well as all IA equipment to demob. All equipment was accounted for and manifested. Orders from the IC to leave 3 five gallon and 6 one gallon cubees for the incoming crew was made and was also noted with dispatch. And two loads of a type 2 hand crew were flown in. IC5 command was transferred over by Hesseling to incoming IC5 Leeman after accepting him off the helicopter and walking the fire line and going over the areas of concern, prior shift details, and overall fire behavior. Also noted that helicopter 30G had just gotten done dropping 19 buckets on the west, North and Northeast parts of the fire. Leeman accepted control and Hesseling notified Medford Dispatch that IC5 command had been properly transferred over to Leeman at 17:09.',42,1.0000,0.0000,-123,48.0000,0.0000,'http://www.google.com/calendar/feeds/default/private/full/trbjnco42ioe70qglsd7l0nakc/63516517542'),(137,'2013-08-15 00:00:00','wf','or-upf-000229','big bend','p6ek2m','0615',0.10,5,'3,5','North Umpqua Ranger District (NURD). Hsu transitioned with N. Umpqua Engine 65 who had originally staffed the fire. A complex lightning-struck tree had prevented the engine crew from lining the majority of the fire and they had to hike out before dark. Larrimore cut the C tree, mop-up took 2 days, 6-hour watch was completed on the 3rd day.  The packout route went through Bristow Prairie onto the Willamette.',43,26.0000,37.0000,-122,28.0000,8.0000,'http://www.google.com/calendar/feeds/default/private/full/5avb0fol7l4imeo43v67e07vco/63512529862'),(138,'2013-08-16 00:00:00','wf','or-rsf-000611','red creek fire','pjek2j','0610',1.00,5,'3','Lightning caused holdover fire, scabby one acre burn. Used 1 fuel cycle of buckets from Helicopter 917 on the second shift. No injuries or equipment damaged during the assignment.',42,47.0000,4.0000,-122,12.0000,2.0000,'http://www.google.com/calendar/feeds/default/private/full/1n346nat9qbqmm9vigfsmu6cuo/63512710453'),(139,'2013-08-19 00:00:00','wf','or-rsf-000620','abbott fire','p6ek2j','0610',1.00,4,'3,4,5','ICT5 transferred to ICT4.',42,57.0000,199.0000,-122,30.0000,778.0000,'http://www.google.com/calendar/feeds/default/private/full/5sas0sikbmvqurmlu4njnnoif4/63512814102'),(140,'2013-08-07 00:00:00','wf','or-rsf-130509','manzanita','p6ek2j','0610',1.50,5,'3,4','Fairly complex Type 5 fire. Hand crew requested, Type 4 IC ordered and cancelled. C-GRNR dropped 4 buckets of water. E-58 assisted with mop-up.',42,59.0000,514.0000,-122,27.0000,366.0000,'http://www.google.com/calendar/feeds/default/private/full/k7f52n8c5rbn32k4fcftkrgs5o/63512816433'),(141,'2013-08-22 00:00:00','wf','or-rsf-000649','ramsey creek','p6ek2j','0610',0.10,5,'2,3,5','2-man fire on Wild Rivers Ranger District - near Wilderville.',42,23.0000,6.0000,-123,36.0000,45.0000,'http://www.google.com/calendar/feeds/default/private/full/0cscfu5j19lul10v2s6l37c198/63513063056'),(142,'2013-08-22 00:00:00','wf','or-rsf-000640','ridge top fire','p6ek2j','0610',0.10,5,'1,2,5','Single stick rappelled into the fire just after 17:00. Mayfield was ICT5 (q) and Hesseling was ICT5 (t). The fire was a single tree, lightning casued. Fire was creeping and smoldering. Spread potential was low to none. No threats to the area. Firefighter safety was the main concern with uneven terrain and loose lava rocks. Due to the time of engagement, it took most of the evening to get the fire lined good enough to feel comfortable bedding down for the night (24:00). Spent two more additional shifts mopping up and met a forest service vehicle for a pick up at the end of the 0910 road after a 2.2 mile pack out.',42,13.0000,45.0000,-123,40.0000,96.0000,'http://www.google.com/calendar/feeds/default/private/full/tdgar7tks10m6f5v878b56o5mk/63513076711'),(143,'2013-08-02 00:00:00','wf','or-wil-000110','nash lake','p6ek2r','0618',0.10,5,'2,3','Multiple struck trees and 4 spot fires .2 miles from a wonderful lake. Lots of mosquitos!',0,0.0000,0.0000,0,0.0000,0.0000,'http://www.google.com/calendar/feeds/default/private/full/4mc4f0q9kuhf4ti1eb91bondus/63513130662'),(144,'2013-08-05 00:00:00','wf','or-wif-130112','harvey creek','p6ek2r','0618',0.25,5,'3','Rappelled into fire as a C faller for a 39\" hazard tree with some fire in the crown of tree. Went well and put the fire out.',0,0.0000,0.0000,0,0.0000,0.0000,'http://www.google.com/calendar/feeds/default/private/full/roc43me6pfeo8qf36q51aq