ase ASAP to get your name known.</div>'),('dquinones','2015-11-13 14:43:24','<h2>Current Vacancies:</h2><br>\r\n\r\n        <br>\r\n        <span style=\"font-weight:bold\">Temporary Seasonal 1039:</span><div><b><br></b>\r\n		Seasonal hiring for the 2016 fire season has not yet begun, however, the vacancy announcements will be posted on USAJobs November 30th-December 7th. The GS-5 positions will be listed under <b>Helitack </b>and the GS-4 positions will be listed under <b>Suppression </b>with a duty station of <b>Grants Pass, OR</b> for both grades.<div><br><div>This will be a regional hiring effort, so be specific on where you want to work and contact those programs early and often.&nbsp;<br><div><div><br></div><div><b>Permanent GS-4/5 Senior Firefighter:</b><br>\r\n\r\n        <br>We are currently outreaching for a Senior Firefighter on our crew with an intent to fill in the Spring of 2016. The outreach announcement will remain posted on the Outreach Database for 14 days after a specific 7 day outreach is completed for the forest.&nbsp;</div><div>If you have an interest in this highly competitive position, contact the base ASAP to get your name known.</div></div></div></div></div>'),('tlyda','2015-12-01 13:14:46','<h2>Current Vacancies:</h2><br>\r\n\r\n        <br>\r\n        <span style=\"font-weight:bold\">Temporary Seasonal 1039:</span><div><b><br></b>\r\n		Seasonal hiring for the 2016 fire season begun, &nbsp;the vacancy announcements are posted on USAJobs November 30th-December 7th. The GS-5 positions will be listed under <b>Helitack with a Grants Pass, OR for a duty station</b>and the GS-4 positions will be listed under <b>Suppression </b>with a duty station of <b>Merlin, OR</b>&nbsp;. Sorry for any confusion we are combining our list with the local handcrew.<div><br><div>This will be a regional hiring effort, so be specific on where you want to work and contact those programs early and often.&nbsp;<br><div><div><br></div><div><b>Permanent GS-4/5 Senior Fir