 highly competitive positions, contact the base ASAP to get your name known and schedule a visit.</div></div></div></div></div>'),('evanhsu','2016-02-26 13:37:02','<h2>Current Vacancies:</h2>\r\n        <span style=\"font-weight:bold\">Temporary Seasonal 1039:</span><div>Selections have been made for the 2016 fire season. &nbsp;Thank you for your interest, and keep in touch for 2017.<br><div><br><div><div><br></div><div><b>Permanent GS-4/5 Senior Firefighters:</b></div><div>Selections for the GS-4/5 PSE positions are currently making their way through the approval process and will be announced during the month of March.</div></div></div></div>'),('dquinones','2016-09-01 17:20:41','<h2>Current Vacancies:</h2>\r\n        <span style=\"font-weight:bold\">Temporary Seasonal 1039:</span><div>Selections have been made for the 2016 fire season. &nbsp;Thank you for your interest, and keep in touch for 2017.<br><div><br><div><div><br></div><div><b>Permanent GS-4/5 Senior Firefighters:</b></div><div>No vacancies.</div></div></div></div><div><br></div><div><b>Permanent GS-6/7 Squad Leaders:</b></div><div>There are currently 2 vacancies on the crew with a desire to fill this Fall. The draft vacancy announcement is being revised and should show up in its final form on USAJobs September 6-12. The positions are 18/8 with a duty station of Grants Pass, OR.</div>'),('dquinones','2016-09-08 14:01:05','<h2>Current Vacancies:</h2>\r\n        <span style=\"font-weight:bold\">Temporary Seasonal 1039:</span><div>Selections have been made for the 2016 fire season. &nbsp;Thank you for your interest, and keep in touch for 2017.<br><div><br><div><div><br></div><div><b>Permanent GS-4/5 Senior Firefighters:</b></div><div>No vacancies.</div></div></div></div><div><br></div><div><b>Permanent GS-6/7 Squad Leaders:</b></div><div>There are currently 2 vacancies on the crew with a desire to fill this Fall. The draft vacancy announcement is being revised and should show up in its final form on USAJobs sometime during the month of September. The positions are 18/8 with a duty station of Grants Pass, OR.</div>'),('dquinones','2016-09-12 15:50:07','<h2>Current Vacancies:</h2>\r\n        <span style=\"font-weight:bold\">Temporary Seasonal 1039:</span><div>Selections have been made for the 2016 fire season. &nbsp;Thank you for your interest, and keep in touch for 2017.<br><div><br><div><div><br></div><div><b>Permanent GS-4/5 Senior Firefighters:</b></div><div>No vacancies.</div></div></div></div><div><br></div><div><b>Permanent GS-6/7 Squad Leaders:</b></div><div>There are currently 2 vacancies on the crew with a desire to fill this Fall. The vacancy announcement will be posted to USAJobs 09/13/2016 and close on 09/22/2016. The positions are being flown MERIT with tours of 18/8 and a duty station of Grants Pass, OR.</div><div><br></div><div><p class=\"MsoNormal\"><span style=\"font-family: Tahoma, sans-serif;\"><a href=\"https://www.usajobs.gov/GetJob/ViewDetails/450299800\">https://www.usajobs.gov/GetJob/ViewDetails/450299800</a><o:p></o:p></span></p></div>'),('dquinones','2016-10-06 11:41:44','<h2>Current Vacancies:</h2>\r\n        <span style=\"font-weight:bold\">Temporary Seasonal 1039:</span><div>The 2017 announcements should be posted on USAJobs November 15-30, 2016.<br><div><br><div><div><br></div><div><b>Permanent GS-4/5 Senior Firefighters:</b></div><div>No current vacancies.</div></div></div></div><div><br></div><div><b>Permanent GS-6/7 Squad Leaders:</b></div><div>There are currently 2 vacancies on the crew that we are working to fill as we speak.</div><div><br></div>'),('dquinones','2016-10-06 12:24:28','<h2>Current Vacancies:</h2>\r\n        <span style=\"font-weight:bold\">Temporary Seasonal 1039:</span><div>The 2017 announcements should be posted on USAJobs November 15-30, 2016.<br><div><br><div><div><br></div><div><b>Permanent GS-4/5 Senior Firefighters:</b></div><div>No current vacancies.</div></div></div></div><div><br></div><div><b>Permanent GS-6/7 Squad Leaders:</b></div><div>There are currently 2 vacancies on the crew that we are working to fill as we speak.</div><div><br></div>'),('dquinones','2016-10-28 15:44:34','<h2>Current Vacancies:</h2>\r\n        <span style=\"font-weight:bold\">Temporary Seasonal 1039:</span><div>The 2017 announcements should be posted on USAJobs November 15-30, 2016.<br><div><br><div><div><br></div><div><b>Permanent GS-4/5 Senior Firefighters:</b></div><div>No current vacancies, but with perm Fire Hire on the horizon, we encourage you to apply for any position you are interested in for back fill opportunities.</div></div></div></div><div><br></div><div><b>Permanent GS-6/7 Squad Leaders:</b></div><div>There are currently 2 vacancies on the crew, the selections have been made and approved by our Forest Supervisor and are in the hands of ASC for finalization.</div><div><br></div>'),('dquinones','2016-10-31 18:19:09','<h2>Current Vacancies:</h2>\r\n        <span style=\"font-weight:bold\">Temporary Seasonal 1039:</span><div>The 2017 announcements should be posted on USAJobs November 15-30, 2016.<br><div><br><div><div><br></div><div><b>Permanent GS-4/5 Senior Firefighters:</b></div><div>No current vacancies, but with perm Fire Hire on the horizon, we encourage you to apply for any position you are interested in for back fill opportunities.</div></div></div></div><div><br></div><div><b>Permanent GS-6/7 Squad Leaders:</b></div><div>There are currently 2 vacancies on the crew, the selections have been made and approved by our Forest Supervisor and are in the hands of ASC for finalization.</div><div><br></div><div><b>Fire Hire Timelines:</b></div><div><div><b>ï‚· </b>October 1st-October 31st Regional outreach for all fire positions in R-6</div><div><b>ï‚·</b> November 1st-November 15th vacancies open in USA JOBS</div><div><b>ï‚· </b>January 21st-January 30th Subject Matter Expert (SME) application review</div><div><b>ï‚·</b> January 30th- February 9th Recommendation / Selection weeks</div></div><div><br></div>'),('dquinones','2016-11-08 16:12:51','<h2>Current Vacancies:</h2>\r\n        <span style=\"font-weight:bold\">Temporary Seasonal 1039:</span><div>The 2017 announcements should be posted on USAJobs November 15-30, 2016.<br><div><br><div><div><br></div><div><b>Permanent GS-4/5 Senior Firefighters:</b></div><div>No current vacancies, but with perm Fire Hire being implemented, we encourage you to apply for any position you are interested in for back fill opportunities.</div></div></div></div><div><br></div><div>https://www.usajobs.gov/GetJob/ViewDetails/455046300/</div><div><br></div><div><b>Permanent GS-6/7 Squad Leaders:</b></div><div>There are currently 2 vacancies on the crew, the selections have been made and approved by our Forest Supervisor and are in the hands of ASC for finalization.</div><div><br></div><div>https://www.usajobs.gov/GetJob/ViewDetails/455046100/</div><div><br></div><div><br></div><div><b>Perm Fire Hire Timelines:</b></div><div><div><b>ï‚· </b>October 1st-October 31st Regional outreach for all fire positions in R-6</div><div><b>ï‚·</b> November 1st-November 15th vacancies open in USA JOBS</div><div><b>ï‚· </b>January 21st-January 30th Subject Matter Expert (SME) application review</div><div><b>ï‚·</b> January 30th- February 9th Recommendation / Selection weeks</div></div><div><br></div>');
